  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the screened/cleaned
  version of the National Inventory of Dams (NID) that removed dams that have been
  decommissioned and duplicate records at state boundaries (See Supplementary Info
  for Glossary of Terms). The National Inventory of Dams (NID) is a congressionally
  authorized database, which documents dams in the U.S. and its territories. The NID
  was most recently reauthorized in the Dam Safety Act of 2006. The current NID, published
  in 2013, includes information on 87,000 dams that are more than 25 feet high, hold
  more than 50 acre-feet of water, or are considered a significant hazard if they
  fail. The NID is maintained and published by the U.S. Army Corps of Engineers (USACE),
  in cooperation with the Association of State Dam Safety Officials (ASDSO), the states
  and territories, and federal dam-regulating agencies. The database contains information
  about the damu2019s location, size, purpose, type, last inspection, regulatory facts,
  and other technical data. The (dams/catchment) and (dam_storage/catchment) were
  summarized and accumulated into watersheds to produce local catchment-level and
  watershed-level metrics as a point data type (see Data Structure and Attribute Information
  for a description).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
